import React from 'react'
import '../styles/restaurant.css'

const Restaurant = (props) => {
    const displayRestaurant = () => {
        console.log(props.restaurant.restaurantID)
    }
  return (
        <div className='restaurant_container d-flex align-items-center justify-content-center' onClick={()=> {
            displayRestaurant()
        }}>
            <div className='restaurant__img'>
                <img src={props.restaurant.restaurantImage} alt="restaurant-img" className='w-50 h-50'/>
            </div>

            <div className='restaurant__content'>
                <div>
                    <h5 className='rest__name'>{props.restaurant.restaurantName}</h5>
                    <p className='rest__cuisine'>{props.restaurant.cuisine}</p>
                </div>
            </div>
        </div>
  )
}

export default Restaurant
